import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <h1>Juliano Amaral</h1>
      <nav>
        <ul>
          <li>Home</li>
          <li>Sobre</li>
          <li>Projetos</li>
          <li>Contato</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
